import React from 'react';
import { Panel, FlexboxGrid } from 'rsuite';

function ItemCard() {
  return (
    <FlexboxGrid justify='center'>
      <Panel
        shaded
        bordered
        bodyFill
        style={{ display: 'inline-block', width: 340 }}
      >
        <img
          src='https://via.placeholder.com/240x240'
          height='140'
          alt='juup'
        />
        <Panel header='Item Name'>
          <p>
            <small>Item Description</small>
            <ul>
              <li>Size: </li>
              <li>Item code: </li>
            </ul>
          </p>
        </Panel>
      </Panel>
    </FlexboxGrid>
  );
}

export default ItemCard;
